import { useCallback } from "react";
import styled from "styled-components";

const Label1 = styled.div`
  position: relative;
  letter-spacing: -0.02em;
`;
const Label = styled.div`
  display: flex;
  flex-direction: row;
  padding: 0px var(--padding-5xs);
  align-items: center;
  justify-content: flex-start;
`;
const Placeholder = styled.div`
  flex: 1;
  position: relative;
  font-weight: 500;
`;
const InputArea = styled.div`
  flex: 1;
  display: flex;
  flex-direction: row;
  padding: var(--padding-5xs);
  align-items: center;
  justify-content: flex-start;
`;
const InputField = styled.div`
  align-self: stretch;
  border-radius: 13px;
  background-color: var(--ui-white);
  box-shadow: 0px 4px 16px rgba(26, 31, 22, 0.15);
  overflow: hidden;
  display: flex;
  flex-direction: row;
  padding: var(--padding-5xs) var(--padding-base);
  align-items: center;
  justify-content: flex-start;
  font-size: var(--body-normal-medium-normal-size);
  color: var(--font-placeholder);
`;
const Input = styled.div`
  width: 507px;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: center;
  gap: var(--gap-5xs);
`;
const TopBar = styled.div`
  display: flex;
  flex-direction: column;
  padding: var(--padding-5xs);
  align-items: flex-start;
  justify-content: flex-start;
`;
const ImageIcon = styled.img`
  position: absolute;
  height: 100%;
  width: 100%;
  top: 0%;
  right: 0%;
  bottom: 0%;
  left: 0%;
  max-width: 100%;
  overflow: hidden;
  max-height: 100%;
  object-fit: cover;
`;
const ProductImage1 = styled.div`
  flex: 1;
  position: relative;
  height: 200px;
`;
const ProductImage = styled.div`
  border-radius: var(--br-3xl);
  background-color: var(--ui-white);
  width: 191.36px;
  overflow: hidden;
  display: flex;
  flex-direction: row;
  padding: var(--padding-base);
  box-sizing: border-box;
  align-items: center;
  justify-content: center;
  cursor: pointer;
`;
const ItemName = styled.div`
  position: relative;
  font-weight: 500;
`;
const SmallDescription = styled.div`
  position: relative;
  font-size: var(--body-small-regular-condensed-size);
  letter-spacing: -0.02em;
  color: var(--font-tertiary);
`;
const Icon13 = styled.img`
  position: relative;
  width: 18px;
  height: 18px;
  overflow: hidden;
  flex-shrink: 0;
`;
const Button = styled.div`
  border-radius: var(--br-4xs);
  background-color: var(--font-dark);
  overflow: hidden;
  display: flex;
  flex-direction: row;
  padding: var(--padding-5xs);
  align-items: center;
  justify-content: center;
`;
const Action = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: row;
  padding: var(--padding-5xs);
  align-items: center;
  justify-content: space-between;
`;
const Content = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: column;
  padding: var(--padding-5xs);
  align-items: flex-start;
  justify-content: center;
  gap: var(--gap-5xs);
`;
const ItemCard = styled.div`
  border-radius: var(--br-3xl);
  box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
  overflow: hidden;
  display: flex;
  flex-direction: column;
  padding: var(--padding-base);
  align-items: flex-start;
  justify-content: center;
  gap: var(--gap-5xs);
`;
const ProductImage2 = styled.div`
  border-radius: var(--br-3xl);
  background-color: var(--ui-white);
  width: 191.36px;
  overflow: hidden;
  display: flex;
  flex-direction: row;
  padding: var(--padding-base);
  box-sizing: border-box;
  align-items: center;
  justify-content: center;
`;
const ItemCard1 = styled.div`
  border-radius: var(--br-3xl);
  overflow: hidden;
  display: flex;
  flex-direction: column;
  padding: var(--padding-base);
  align-items: flex-start;
  justify-content: center;
  gap: var(--gap-5xs);
`;
const Row01 = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  gap: var(--gap-base);
`;
const Row02 = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: row;
  padding: var(--padding-base);
  align-items: center;
  justify-content: center;
  gap: var(--gap-base);
`;
const ContentArea = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: column;
  padding: var(--padding-5xs) 0px;
  align-items: center;
  justify-content: flex-start;
  font-size: var(--body-normal-medium-normal-size);
  color: var(--font-dark);
`;
const ContentFrame = styled.div`
  position: absolute;
  top: 0px;
  left: 122px;
  width: 953px;
  overflow-y: auto;
  display: flex;
  flex-direction: column;
  padding: var(--padding-5xl);
  box-sizing: border-box;
  align-items: center;
  justify-content: flex-start;
